import React from "react";
import StarRating from 'react-bootstrap-star-rating';

function Rating({ value, text, color }) {
  return (
    <div className="rating">
      <StarRating
        defaultValue={5}
        min={0}
        max={10}
        step={0.5} />
      <span>
        {text && text}
      </span>
    </div>
  );
}

export default Rating;
